import React from 'react';
import ChessFactory from './model/Chess.js';
import Board from './components/Board';

import './App.css';

const App = () => {

    const chess = ChessFactory();

    return (
        <div>
            <button onClick={() => chess.printMoves()}></button>
            <Board chess={chess} />
            <div>
                {chess.moveHistory.map((move, key) => {
                    return <p key={key}>{`${key}. ${move}`}</p>
                })}
            </div>
        </div>
    );
}

export default App;
